Similar to golang and pointers are treated with references and & use rand::Rng;
use std::cmp::Ordering; fn main() { let guess :i32 = 10; let secret_number :&i32 = &rand::thread_rng().gen_range(1..=10); match guess.cmp(secret_number) { Ordering::Less => println!("Too small!"), Ordering::Greater => println!("Too big!"), Ordering::Equal => println!("You win!"), } println!("{}", *secret_number)
} The main aim of lifetimes is to prevent dangling references , which cause a program to reference data other than the data itâ€™s intended to reference. fn main() { let ref_x: &i32; { let x: i32 = 10; ref_x = &x; } println!("ref_x: {ref_x}");
} Won't compile because the value ref_x is referring to has gone out of scope before we try to use it.

