A few implicit conversions: println!("{x} * {y} = {} -- {} {}", multiply(i16::from(x), y), y.to_string(), f64::from(y)); Array loops, matrices transposition. fn transpose(mut matrix: [[i32; 3]; 3]) -> [[i32; 3]; 3] { // returning cloned transpose for now. requires research on borrowing concept. let mut new_matrix:[[i32; 3]; 3] = matrix.clone(); for (i, r) in matrix.iter().enumerate() { for (j, _c) in r.iter().enumerate() { new_matrix[i][j] = matrix[j][i]; } } return new_matrix
} fn pretty_print(matrix: &[[i32; 3]; 3]) { println!("{:?}", matrix);
} fn main() { let matrix = [ [101, 102, 103], // <-- the comment makes rustfmt add a newline [201, 202, 203], [301, 302, 303], ]; println!("matrix:"); pretty_print(&matrix); let transposed = transpose(matrix); println!("transposed:"); pretty_print(&transposed);
}

